										dataElements.push({id:"c1d7ee44-7d20-4fb0-95d6-64c0e766655f", type:"Contract", specialization:decodeURL(""), name:decodeURL("Organisatorisk+samhandlingsavtale"), documentation:decodeURL("DESCRIPTION%3A%0D%0AConcrete+and+binding+documents+which+set+out+the+precise+obligations+of+two+parties+cooperating+across+an+%E2%80%98interface%E2%80%99+to+achieve+interoperability.+%0D%0AThis+ABB+is+a+key+interoperability+enabler+%28*%29+for+assessing+the+TERMS%2FCONDITIONS+for+SHARING%26REUSING+AND+EXCHANGING+information.%0D%0AAn+Interoperability+Agreement+is+the+means+through+which+organisations+%28public+administrations%2C+or+businesses%29+formalises+the+cooperation+with+one+another.+These+agreements+aim+at+the+development+of+interoperability+solutions%2C+which+meets+the+functional+%2F+technical+requirements+and+needs+of+one+another+%28European+Interoperability+Framework%29.+%0D%0A%0D%0ASource+ISA2%2C+EIFv2%0D%0Ahttps%3A%2F%2Fec.europa.eu%2Fisa2%2Fisa2_en%0D%0A%0D%0A%28*%29DECISION+%28EU%29+2015%2F2240+OF+THE+EUROPEAN+PARLIAMENT+AND+OF+THE+COUNCIL+of+25+November+2015+establishing+a+programme+on+interoperability+solutions+and+common+frameworks+for+European+public+administrations%2C+businesses+and+citizens+%28ISA2+programme%29+as+a+means+for+modernising+the+public+sector.%0D%0A%0D%0AThe+agreement+should+include+purposes+and+goals%2C+terms+and+conditions%2C+governance%2C+and+the+description+of+the+channel%28s%29.+The+EIRA%C2%A9+differentiates+the+following+Interoperability+Agreements%3A%0D%0A%0D%0A%E2%80%A2%09Interoperability+Service+Agreement+%28between+Public+Service+Consumers+and+Public+Service+Providers%3B%0D%0A%E2%80%A2%09Interoperability+Collaboration+Agreement+%28between+Organisations%29%3B+or%0D%0A%E2%80%A2%09Interoperability+Provider+Agreement+%28between+Public+Service+Providers%29.%0D%0A%0D%0AINTEROPERABILITY+SALIENCY%3A%0D%0AThe+Organisational+Interoperability+Agreement+ABB+%C2%A0is+a+key+interoperability+enabler+because+it+helps+achieve+organisational+interoperability+by+assessing+and+formalising+terms+and+conditions+for+sharing%2Freusing%2Fexchanging+information+between+two+cooperating+parties+as+stated+in+the+EIF+Recommendation+26%3A+%22Establish+interoperability+agreements+in+all+layers%2C+complemented+by+operational+agreements+and+change+management+procedures.%22%0D%0A%0D%0AEXAMPLES%3A%0D%0AThe+following+implementation+is+an+example+on+how+this+specific+Architecture+Building+Block+%28ABB%29+can+be+instantiated+as+a+Solution+Building+Block+%28SBB%29%3A+%0D%0A%0D%0AICAO+Service+Level+Agreement+Template%09%0D%0AA+Service+Level+Agreement+%28SLA%29+is+an+example+of+Interoperability+Agreement+in+which+parties+agree+on+the+description+of+the+services+to+be+provided+by+one+or+several+parties+to+the+other+one%28s%29.+The+SLA+tackles+topics+like%3A+service+description%2C+optional+services%2C+exclusions%2C+limitations%2C+service+levels%2C+service+credits%2C+escalation+procedure%2C+reporting+and+points+of+contact.%0D%0Ahttps%3A%2F%2Fwww.icao.int%2FESAF%2FDocuments%2FAPIRG%2FAPIRG18%2FDocs%2Fwp17_appendices_en.pdf+%0D%0A")});

+conditions+for+sharing%2Freusing%2Fexchanging+information+between+two+cooperating+parties+as+stated+in+the+EIF+Recommendation+26%3A+%22Establish+interoperability+agreements+in+all+layers%2C+complemented+by+operational+agreements+and+change+management+procedures.%22%0D%0A%0D%0AEXAMPLES%3A%0D%0AThe+following+implementation+is+an+example+on+how+this+specific+Architecture+Building+Block+%28ABB%29+can+be+instantiated+as+a+Solution+Building+Block+%28SBB%29%3A+%0D%0A%0D%0AICAO+Service+Level+Agreement+Template%09%0D%0AA+Service+Level+Agreement+%28SLA%29+is+an+example+of+Interoperability+Agreement+in+which+parties+agree+on+the+description+of+the+services+to+be+provided+by+one+or+several+parties+to+the+other+one%28s%29.+The+SLA+tackles+topics+like%3A+service+description%2C+optional+services%2C+exclusions%2C+limitations%2C+service+levels%2C+service+credits%2C+escalation+procedure%2C+reporting+and+points+of+contact.%0D%0Ahttps%3A%2F%2Fwww.icao.int%2FESAF%2FDocuments%2FAPIRG%2FAPIRG18%2FDocs%2Fwp17_appendices_en.pdf+%0D%0A")});

										dataElements.push({id:"3a8d0cad-5241-4a9a-82d8-2763094f7a0a", type:"ApplicationService", specialization:decodeURL(""), name:decodeURL("Data+Publication+Service"), documentation:decodeURL("DESCRIPTION%3A%0D%0AShares+the+functionality+of+making+data+available+for+common+use.%0D%0A%0D%0ABased+on+DAMA%0D%0Ahttp%3A%2F%2Fwww.dama.org%2F+++%0D%0A%0D%0AINTEROPERABILITY+SALIENCY%3A%0D%0AThe+Data+Pubblication+Service+ABB+%C2%A0is+salient+for+technical+interoperability+because+it+provides+the+functionalities+to+make+public+data+freely+available+for+use+and+reuse+by+others+unless+restriction+aoply+as+stated+in+the+EIF+recommendation+n.2%3A+%22Publish+the+data+you+own+as+open+data+unless+certain+restrictions+apply.%22%0D%0A%0D%0AEXAMPLES%3A%0D%0AThe+following+implementation+is+an+example+on+how+this+specific+Architecture+Building+Block+%28ABB%29+can+be+instantiated+as+a+Solution+Building+Block+%28SBB%29%3A%0D%0AEuropean+Data+Portal+%0D%0AThe+European+Data+Portal+harvests+the+metadata+of+Public+Sector+Information+available+on+public+data+portals+across+European+countries.+Information+regarding+the+provision+of+data+and+the+benefits+of+re-using+data+is+also+included.%0D%0AWhat+is+Open+Data%3F%0D%0A-%09Open+%28Government%29+Data+refers+to+the+information+collected%2C+produced+or+paid+for+by+the+public+bodies+%28also+referred+to+as+Public+Sector+Information%29+and+made+freely+available+for+re-use+for+any+purpose.+The+licence+will+specify+the+terms+of+use.+%0D%0A-%09Public+sector+information+is+information+held+by+the+public+sector.+The+Directive+on+the+re-use+of+public+sector+information+provides+a+common+legal+framework+for+a+European+market+for+government-held+data.+It+is+built+around+the+key+pillars+of+the+internal+market%3A+free+flow+of+data%2C+transparency+and+fair+competition.+It+is+important+to+note+that+not+all+of+the+public+sector+information+is+Open+Data.%0D%0AWithin+the+Portal%2C+sections+are+dedicated+to%3A%0D%0A-%09Searching+datasets%3A+Categories+have+been+established+to+structure+the+metadata+harvested+from+the+various+countries.+These+categories+follow+the+revision+of+the+DCAT+Application+Profile+and+have+been+mapped+against+the+Eurovoc+Thesaurus.%0D%0A-%09Providing+Data%3A+This+section+gives+an+insight+into+understanding+Open+Data+from+the+perspective+of+a+data+provider.+In+addition%2C+instructions+are+offered+for+those+who+wish+their+data+portal+to+be+harvested+by+the+European+Data+Portal.%0D%0A-%09Using+Data%3A+How+Open+Data+is+being+used%2C+as+well+as+the+economic+benefits+of+Open+Data+are+detailed+in+this+section.%0D%0A-%09Training+and+Library%3A+eLearning+modules+about+Open+Data+as+well+as+training+guides+and+a+knowledge+base+referencing+publications+around+Open+Data+and+featured+projects.%0D%0APortals+can+be+national%2C+regional%2C+local+or+domain+specific.+They+cover+the+28+EU+Member+States%2C+EEA%2C+countries+involved+in+the+EU%27s+neighbourhood+policy+and+Switzerland.%0D%0Ahttps%3A%2F%2Fwww.europeandataportal.eu%2F+++%0D%0A%0D%0ABelgian+Data+Portal%0D%0AThe+Belgian+Data+Portal+provides+data+%28more+than+6500+datasets%29%2C+tools+and+resources.%0D%0AOpen+Data+is+a+driver+for+innovation%2C+economic+growth%2C+transparency+and+participation.+According+to+a+European+study+%28ref.COM+%282011%29+882%29+the+cumulative+economic+benefits+arising+from+the+provision+of+public+data+would+amount+to+%E2%82%AC+40+billion+per+year+in+the+EU.+These+data+lend+themselves+to+reuse+in+the+context+of+new+products+and+services+and+can+improve+the+efficiency+of+public+authorities.+Making+public+sector+data+accessible+makes+it+possible+to+involve+citizens+more+in+political+and+social+life+and+to+make+an+active+contribution+to+policy+areas+such+as+the+environment%2C+mobility%2C+the+economy%2C+and+so+on.%0D%0AThe+2014-2018+Belgian+government+agreement+states+that+the+government+will+focus+on+opening+public+sector+data+%28Open+Data+policy%29.+Open+public+data+is+now+the+rule.+Public+services+make+available+to+citizens%2C+researchers%2C+companies+and+public+authorities+the+reuse+of+data+already+available+to+them+in+the+framework+of+their+missions.%0D%0AIt+is+more+specifically+data+that%3A%0D%0A-%09Public+services+have+collected+as+part+of+their+data+collection+missions%3B%0D%0A-%09Do+not+contain+%28more%29+privacy-sensitive+information+that+is+not+protected+by+intellectual+property+rights+held+by+third+parties%3B%0D%0A-%09Are+published+in+a+format+that+is+easy+to+reuse+automatically+%28%22machine+readable+%22%29%3B%0D%0A-%09Can+be+reused+for+commercial+and+non-commercial+purposes.%0D%0AIt+is+not+only+a+matter+of+making+public+service+data+available%2C+but+also+of+building+a+community+environment+around+these+data.+Companies+can+reuse+some+data+and+enrich+it+with+their+own+information+to+market+new+products+and+services.+Citizens+benefit+from+more+transparent+public+authorities+and+public+services+can+help+improve+the+quality+of+existing+public+data+and+services.%0D%0Ahttp%3A%2F%2Fdata.gov.be%2Fen+%0D%0A")});

m+the+various+countries.+These+categories+follow+the+revision+of+the+DCAT+Application+Profile+and+have+been+mapped+against+the+Eurovoc+Thesaurus.%0D%0A-%09Providing+Data%3A+This+section+gives+an+insight+into+understanding+Open+Data+from+the+perspective+of+a+data+provider.+In+addition%2C+instructions+are+offered+for+those+who+wish+their+data+portal+to+be+harvested+by+the+European+Data+Portal.%0D%0A-%09Using+Data%3A+How+Open+Data+is+being+used%2C+as+well+as+the+economic+benefits+of+Open+Data+are+detailed+in+this+section.%0D%0A-%09Training+and+Library%3A+eLearning+modules+about+Open+Data+as+well+as+training+guides+and+a+knowledge+base+referencing+publications+around+Open+Data+and+featured+projects.%0D%0APortals+can+be+national%2C+regional%2C+local+or+domain+specific.+They+cover+the+28+EU+Member+States%2C+EEA%2C+countries+involved+in+the+EU%27s+neighbourhood+policy+and+Switzerland.%0D%0Ahttps%3A%2F%2Fwww.europeandataportal.eu%2F+++%0D%0A%0D%0ABelgian+Data+Portal%0D%0AThe+Belgian+Data+Portal+provides+data+%28more+than+6500+datasets%29%2C+tools+and+resources.%0D%0AOpen+Data+is+a+driver+for+innovation%2C+economic+growth%2C+transparency+and+participation.+According+to+a+European+study+%28ref.COM+%282011%29+882%29+the+cumulative+economic+benefits+arising+from+the+provision+of+public+data+would+amount+to+%E2%82%AC+40+billion+per+year+in+the+EU.+These+data+lend+themselves+to+reuse+in+the+context+of+new+products+and+services+and+can+improve+the+efficiency+of+public+authorities.+Making+public+sector+data+accessible+makes+it+possible+to+involve+citizens+more+in+political+and+social+life+and+to+make+an+active+contribution+to+policy+areas+such+as+the+environment%2C+mobility%2C+the+economy%2C+and+so+on.%0D%0AThe+2014-2018+Belgian+government+agreement+states+that+the+government+will+focus+on+opening+public+sector+data+%28Open+Data+policy%29.+Open+public+data+is+now+the+rule.+Public+services+make+available+to+citizens%2C+researchers%2C+companies+and+public+authorities+the+reuse+of+data+already+available+to+them+in+the+framework+of+their+missions.%0D%0AIt+is+more+specifically+data+that%3A%0D%0A-%09Public+services+have+collected+as+part+of+their+data+collection+missions%3B%0D%0A-%09Do+not+contain+%28more%29+privacy-sensitive+information+that+is+not+protected+by+intellectual+property+rights+held+by+third+parties%3B%0D%0A-%09Are+published+in+a+format+that+is+easy+to+reuse+automatically+%28%22machine+readable+%22%29%3B%0D%0A-%09Can+be+reused+for+commercial+and+non-commercial+purposes.%0D%0AIt+is+not+only+a+matter+of+making+public+service+data+available%2C+but+also+of+building+a+community+environment+around+these+data.+Companies+can+reuse+some+data+and+enrich+it+with+their+own+information+to+market+new+products+and+services.+Citizens+benefit+from+more+transparent+public+authorities+and+public+services+can+help+improve+the+quality+of+existing+public+data+and+services.%0D%0Ahttp%3A%2F%2Fdata.gov.be%2Fen+%0D%0A")});

										dataElements.push({id:"id-d0c567f18b844e969379cb893bca2466", type:"SystemSoftware", specialization:decodeURL(""), name:decodeURL("MTOM"), documentation:decodeURL("Message+Transmission+Optimization+Mechanism+%28MTOM%29+is+a+method+for+efficiently+sending+large+binary+attachments%2C+such+as+images%2C+videos%2C+or+files%2C+within+a+SOAP+%28Simple+Object+Access+Protocol%29+message+over+the+internet.+SOAP+is+an+XML-based+messaging+protocol+used+for+exchanging+structured+information+in+the+implementation+of+web+services+in+computer+networks.%0D%0A%0D%0AIn+a+typical+SOAP+message%2C+binary+data+is+encoded+using+Base64+encoding%2C+which+increases+the+size+of+the+message+by+approximately+33%25.+This+can+lead+to+performance+issues+and+increased+network+bandwidth+usage%2C+especially+when+dealing+with+large+binary+attachments.%0D%0A%0D%0AMTOM+addresses+this+problem+by+optimizing+the+transmission+of+binary+data+in+SOAP+messages.+Instead+of+embedding+the+binary+data+directly+within+the+XML+message+using+Base64+encoding%2C+MTOM+uses+XOP+%28XML-binary+Optimized+Packaging%29+to+package+the+binary+data+separately+from+the+XML+message.+The+binary+data+is+sent+as-is%2C+without+Base64+encoding%2C+alongside+the+XML+message+as+a+MIME+%28Multipurpose+Internet+Mail+Extensions%29+attachment.%0D%0A%0D%0AThis+approach+reduces+the+overall+message+size+and+improves+the+efficiency+of+transmitting+binary+data+in+SOAP+messages.+The+recipient+can+still+process+the+XML+message+and+access+the+binary+attachment+seamlessly%2C+without+any+significant+changes+to+the+web+service+implementation.%0D%0A%0D%0AIn+summary%2C+MTOM+is+an+optimization+mechanism+for+transmitting+large+binary+attachments+within+SOAP+messages.+It+reduces+message+size+and+network+bandwidth+usage+by+sending+binary+data+as+MIME+attachments+rather+than+embedding+them+in+the+XML+message+using+Base64+encoding.%0D%0A%0D%0AMTOM+%28Message+Transmission+Optimization+Mechanism%29+itself+does+not+impose+specific+size+limits+on+binary+attachments.+However%2C+the+size+limits+for+MTOM+attachments+may+be+influenced+by+various+factors%2C+including+the+web+service+implementation%2C+the+application+server%2C+and+the+network+infrastructure.+Some+common+factors+that+may+impact+the+size+limits+for+MTOM+attachments+are%3A%0D%0A%0D%0AWeb+service+and+application+server+configurations%3A+Different+web+service+frameworks+and+application+servers+may+have+their+own+default+settings+or+configurable+limits+on+the+size+of+SOAP+messages%2C+including+MTOM+attachments.+These+limits+can+usually+be+adjusted+in+the+server+or+framework+configuration+files.%0D%0A%0D%0ANetwork+constraints%3A+Network+infrastructure%2C+including+routers%2C+switches%2C+and+firewalls%2C+may+impose+limits+on+the+size+of+data+packets+that+can+be+transmitted.+This+could+affect+the+maximum+size+of+MTOM+attachments+that+can+be+sent+without+encountering+network-related+issues.%0D%0A%0D%0AClient+and+server+resources%3A+The+resources+available+on+the+client+and+server%2C+such+as+memory+and+processing+power%2C+can+impact+the+handling+of+large+MTOM+attachments.+Insufficient+resources+may+lead+to+performance+issues+or+failures+when+processing+large+attachments.%0D%0A%0D%0AIntermediary+systems%3A+In+some+cases%2C+SOAP+messages+with+MTOM+attachments+may+pass+through+intermediary+systems%2C+such+as+proxy+servers%2C+which+could+impose+their+own+size+limits+on+message+attachments.%0D%0A%0D%0AThe+size+limits+for+MTOM+attachments+may+vary+depending+on+the+specific+environment+and+configuration.+It+is+essential+to+review+the+relevant+documentation+for+the+web+service+framework%2C+application+server%2C+and+network+infrastructure+to+determine+any+size+limitations+and+configure+them+appropriately+to+support+the+desired+attachment+sizes.")});

										dataElements.push({id:"id-ceb924e8a5924d34a3244217931052ce", type:"SystemSoftware", specialization:decodeURL(""), name:decodeURL("SMB+Share"), documentation:decodeURL("An+SMB+%28Server+Message+Block%29+Share+is+a+network+file+sharing+protocol+that+enables+applications+to+read%2C+write%2C+and+request+file+and+print+services+on+remote+computers+or+servers+over+a+local+area+network+%28LAN%29+or+the+internet.+SMB+is+commonly+used+for+sharing+files%2C+printers%2C+and+other+resources+among+multiple+users+or+devices+within+a+network.%0D%0A%0D%0ASMB+Share+allows+users+to+access+files+and+folders+on+remote+servers+as+if+they+were+on+their+local+machines%2C+enabling+collaboration%2C+data+sharing%2C+and+centralized+file+storage.+The+protocol+supports+various+operating+systems%2C+including+Windows%2C+macOS%2C+and+Linux%2C+which+makes+it+versatile+and+widely+used+in+various+network+environments.%0D%0A%0D%0ASMB+has+evolved+over+time%2C+and+different+versions+of+the+protocol+have+been+developed.+The+latest+version%2C+SMB+3.x%2C+comes+with+enhanced+security%2C+performance%2C+and+reliability+features+compared+to+earlier+versions.%0D%0A%0D%0AIn+summary%2C+an+SMB+Share+is+a+way+to+share+files+and+resources+across+a+network+using+the+Server+Message+Block+protocol%2C+facilitating+collaboration+and+centralized+data+storage+in+multi-user+environments.%0D%0A%0D%0ASMB+Shares+can+handle+large+files%2C+but+the+actual+file+size+limit+depends+on+the+version+of+the+SMB+protocol+being+used+and+the+file+system+of+the+shared+storage.%0D%0A%0D%0AFor+SMB+2.x+and+SMB+3.x%2C+the+maximum+file+size+limit+is+16+exabytes+%28EB%29+minus+64+kilobytes+%28KB%29.+However%2C+this+theoretical+limit+is+usually+not+reached+in+practice+because+the+underlying+file+system+itself+imposes+its+own+file+size+limits.+For+example%3A%0D%0A%0D%0ANTFS+%28New+Technology+File+System%29+%E2%80%93+used+in+modern+Windows+systems+%E2%80%93+supports+a+maximum+file+size+of+16+terabytes+%28TB%29+minus+64+KB.%0D%0AHFS%2B+%28Hierarchical+File+System+Plus%29+%E2%80%93+used+in+macOS+%E2%80%93+supports+a+maximum+file+size+of+8+exabytes+%28EB%29+minus+1+byte.%0D%0Aext4+%28Fourth+Extended+Filesystem%29+%E2%80%93+commonly+used+in+Linux+%E2%80%93+supports+a+maximum+file+size+of+16+terabytes+%28TB%29+to+1+exabyte+%28EB%29%2C+depending+on+the+specific+configuration.%0D%0AIn+general%2C+SMB+Shares+are+capable+of+handling+very+large+files%2C+with+the+actual+limit+typically+determined+by+the+file+system+on+the+shared+storage+rather+than+the+SMB+protocol+itself.")});

										dataElements.push({id:"id-3d5cbbe223c54bd68a318564dc39beef", type:"SystemSoftware", specialization:decodeURL(""), name:decodeURL("WCF"), documentation:decodeURL("WCF+stands+for+Windows+Communication+Foundation.+It+is+a+framework+developed+by+Microsoft+as+part+of+the+.NET+Framework+to+build+and+support+service-oriented+applications.+WCF+enables+developers+to+create+distributed+applications+by+providing+a+unified+programming+model+for+building+service-oriented%2C+secure%2C+and+reliable+services+that+can+communicate+across+various+platforms+and+protocols.%0D%0A%0D%0AWCF+supports+multiple+communication+patterns%2C+including+one-way+messaging%2C+request-reply%2C+and+duplex+communication%2C+as+well+as+multiple+transport+protocols+such+as+HTTP%2C+HTTPS%2C+TCP%2C+and+Named+Pipes.+This+makes+WCF+a+versatile+and+powerful+tool+for+creating+services+that+can+be+consumed+by+clients+built+on+various+technologies.%0D%0A%0D%0AWCF+services+can+expose+different+types+of+endpoints%2C+including+SOAP-based+endpoints+and+RESTful+endpoints.+While+REST+is+an+architectural+style+used+for+designing+networked+applications%2C+WCF+is+a+framework+that+can+be+used+to+implement+RESTful+services+along+with+other+communication+patterns+and+protocols.")});

										dataElements.push({id:"id-7d9bc4d1507540af8e735f58f95a1daf", type:"SystemSoftware", specialization:decodeURL(""), name:decodeURL("Binary+Stream"), documentation:decodeURL("A+binary+stream+refers+to+a+continuous+sequence+of+binary+data+%28composed+of+bits%2C+which+are+either+0+or+1%29+that+is+transmitted+or+processed+by+a+computer+system.+Binary+streams+are+often+used+for+reading+or+writing+binary+data%2C+such+as+images%2C+audio+files%2C+video+files%2C+or+other+types+of+non-text+data%2C+from+or+to+files%2C+networks%2C+or+other+data+sources.%0D%0A%0D%0AIn+the+context+of+programming+languages+and+libraries%2C+a+binary+stream+is+typically+represented+as+an+object+or+an+interface+that+allows+developers+to+read+or+write+binary+data+to+a+specified+source%2C+such+as+a+file+or+a+network+socket.+The+binary+stream+provides+methods+for+reading+and+writing+individual+bytes+or+sequences+of+bytes%2C+enabling+the+manipulation+of+binary+data+within+a+program.%0D%0A%0D%0AFor+example%2C+in+the+.NET+Framework%2C+the+Stream+class+is+a+base+class+for+various+types+of+binary+streams%2C+such+as+FileStream+%28for+reading+and+writing+data+to+a+file%29+and+NetworkStream+%28for+reading+and+writing+data+over+a+network+connection%29.+In+Java%2C+the+InputStream+and+OutputStream+classes+serve+as+base+classes+for+different+types+of+binary+streams.%0D%0A%0D%0AWorking+with+binary+streams+allows+developers+to+handle+binary+data+efficiently%2C+as+the+data+is+processed+in+its+native+format+without+the+need+for+additional+encoding+or+decoding%2C+such+as+converting+the+binary+data+to+a+text-based+format+like+Base64.+This+can+lead+to+improved+performance+and+reduced+memory+usage+when+working+with+large+binary+files+or+streaming+data.")});

										dataElements.push({id:"id-103c9e68c84d4dc9850ffba0d6708729", type:"SystemSoftware", specialization:decodeURL(""), name:decodeURL("Multimedia+streaming"), documentation:decodeURL("Multimedia+streaming+protocols+are+used+to+transmit+audio%2C+video%2C+and+other+media+content+over+a+network+efficiently+and+in+real-time.+These+protocols+enable+the+delivery+of+multimedia+content+to+various+devices%2C+such+as+computers%2C+smartphones%2C+and+smart+TVs%2C+while+maintaining+a+high+level+of+quality+and+minimizing+latency.+Some+widely-used+multimedia+streaming+protocols+include%3A%0D%0A%0D%0ARTP+%28Real-time+Transport+Protocol%29%3A+RTP+is+a+network+protocol+designed+for+the+delivery+of+real-time+multimedia+content%2C+such+as+audio+and+video%2C+over+IP+networks.+RTP+is+often+used+in+conjunction+with+RTCP+%28Real-time+Transport+Control+Protocol%29%2C+which+provides+feedback+on+the+quality+of+the+data+transmission+and+helps+maintain+synchronization+between+different+media+streams.%0D%0A%0D%0ARTSP+%28Real+Time+Streaming+Protocol%29%3A+RTSP+is+an+application-level+protocol+that+enables+the+control+of+multimedia+streaming+sessions.+It+allows+clients+to+start%2C+pause%2C+and+stop+the+playback+of+media+streams%2C+as+well+as+to+control+other+aspects+of+the+streaming+session%2C+such+as+selecting+a+specific+media+track+or+adjusting+the+playback+rate.%0D%0A%0D%0AHTTP+Live+Streaming+%28HLS%29%3A+HLS+is+a+streaming+protocol+developed+by+Apple+for+delivering+live+and+on-demand+multimedia+content+over+HTTP.+HLS+divides+media+files+into+small+segments+and+delivers+them+as+a+playlist%2C+allowing+the+client+to+adapt+the+quality+of+the+stream+based+on+its+current+network+conditions.+This+adaptive+streaming+approach+helps+ensure+a+smooth+playback+experience+even+in+fluctuating+network+environments.%0D%0A%0D%0ADynamic+Adaptive+Streaming+over+HTTP+%28DASH%29%3A+DASH+is+an+adaptive+bitrate+streaming+protocol+that%2C+like+HLS%2C+delivers+multimedia+content+in+small+segments+over+HTTP.+DASH+is+codec-agnostic+and+supports+multiple+DRM+%28Digital+Rights+Management%29+systems%2C+making+it+a+flexible+solution+for+delivering+multimedia+content+to+a+wide+range+of+devices+and+platforms.%0D%0A%0D%0ARTMP+%28Real-Time+Messaging+Protocol%29%3A+RTMP+is+a+protocol+developed+by+Adobe+for+streaming+audio%2C+video%2C+and+data+over+the+internet.+RTMP+is+used+primarily+for+low-latency+live+streaming+and+is+often+employed+by+streaming+platforms+and+live+streaming+software.+While+it+has+been+largely+replaced+by+HTTP-based+streaming+protocols%2C+RTMP+is+still+in+use+for+specific+applications+and+scenarios.%0D%0A%0D%0AThese+multimedia+streaming+protocols+each+have+their+own+strengths+and+weaknesses%2C+and+the+choice+of+protocol+depends+on+factors+such+as+latency+requirements%2C+network+conditions%2C+compatibility+with+devices+and+platforms%2C+and+content+protection+needs.")});

										dataElements.push({id:"id-9957b7ee84a746ac8b0e8277e311307c", type:"SystemSoftware", specialization:decodeURL(""), name:decodeURL("SQL+Server**"), documentation:decodeURL("WCF+stands+for+Windows+Communication+Foundation.+It+is+a+framework+developed+by+Microsoft+as+part+of+the+.NET+Framework+to+build+and+support+service-oriented+applications.+WCF+enables+developers+to+create+distributed+applications+by+providing+a+unified+programming+model+for+building+service-oriented%2C+secure%2C+and+reliable+services+that+can+communicate+across+various+platforms+and+protocols.%0D%0A%0D%0AWCF+supports+multiple+communication+patterns%2C+including+one-way+messaging%2C+request-reply%2C+and+duplex+communication%2C+as+well+as+multiple+transport+protocols+such+as+HTTP%2C+HTTPS%2C+TCP%2C+and+Named+Pipes.+This+makes+WCF+a+versatile+and+powerful+tool+for+creating+services+that+can+be+consumed+by+clients+built+on+various+technologies.%0D%0A%0D%0AWCF+services+can+expose+different+types+of+endpoints%2C+including+SOAP-based+endpoints+and+RESTful+endpoints.+While+REST+is+an+architectural+style+used+for+designing+networked+applications%2C+WCF+is+a+framework+that+can+be+used+to+implement+RESTful+services+along+with+other+communication+patterns+and+protocols.")});

										dataElements.push({id:"id-1377ff08c0bb470c899af25636f4d3b6", type:"Assessment", specialization:decodeURL(""), name:decodeURL("Praktisk+st%C3%B8rrelsesbegrensing+p%C3%A5++ca.+1GB+meldinger+"), documentation:decodeURL("Working+with+binary+streams+allows+developers+to+handle+binary+data+efficiently%2C+as+the+data+is+processed+in+its+native+format+without+the+need+for+additional+encoding+or+decoding%2C+such+as+converting+the+binary+data+to+a+text-based+format+like+Base64.+This+can+lead+to+improved+performance+and+reduced+memory+usage+when+working+with+large+binary+files+or+streaming+data.%0D%0A%0D%0A%23%23%23%0D%0A%0D%0AMTOM+%28Message+Transmission+Optimization+Mechanism%29+itself+does+not+impose+specific+size+limits+on+binary+attachments.+However%2C+the+size+limits+for+MTOM+attachments+may+be+influenced+by+various+factors%2C+including+the+web+service+implementation%2C+the+application+server%2C+and+the+network+infrastructure.+Some+common+factors+that+may+impact+the+size+limits+for+MTOM+attachments+are%3A%0D%0A%0D%0AWeb+service+and+application+server+configurations%3A+Different+web+service+frameworks+and+application+servers+may+have+their+own+default+settings+or+configurable+limits+on+the+size+of+SOAP+messages%2C+including+MTOM+attachments.+These+limits+can+usually+be+adjusted+in+the+server+or+framework+configuration+files.%0D%0A%0D%0ANetwork+constraints%3A+Network+infrastructure%2C+including+routers%2C+switches%2C+and+firewalls%2C+may+impose+limits+on+the+size+of+data+packets+that+can+be+transmitted.+This+could+affect+the+maximum+size+of+MTOM+attachments+that+can+be+sent+without+encountering+network-related+issues.%0D%0A%0D%0AClient+and+server+resources%3A+The+resources+available+on+the+client+and+server%2C+such+as+memory+and+processing+power%2C+can+impact+the+handling+of+large+MTOM+attachments.+Insufficient+resources+may+lead+to+performance+issues+or+failures+when+processing+large+attachments.%0D%0A%0D%0AIntermediary+systems%3A+In+some+cases%2C+SOAP+messages+with+MTOM+attachments+may+pass+through+intermediary+systems%2C+such+as+proxy+servers%2C+which+could+impose+their+own+size+limits+on+message+attachments.%0D%0A%0D%0A%23%23%23%0D%0A%0D%0ATo+mitigate+these+potential+issues%2C+you+may+consider%3A%0D%0A%0D%0AAdjusting+server+and+client+configurations+to+handle+larger+messages%2C+such+as+increasing+memory+allocation%2C+modifying+timeout+settings%2C+and+configuring+maximum+message+size+limits.%0D%0A%0D%0AUsing+streaming+techniques+when+available%2C+which+can+allow+you+to+process+and+transmit+large+MTOM+attachments+as+a+stream+of+smaller+chunks%2C+reducing+memory+usage+and+improving+overall+performance.%0D%0A%0D%0ACompressing+the+binary+attachments+before+transmitting+them+to+reduce+their+size+and+minimize+the+impact+on+bandwidth+usage.%0D%0A%0D%0ASplitting+large+binary+attachments+into+smaller+parts+and+sending+them+as+separate+MTOM+messages%2C+which+can+help+circumvent+size+limitations+and+improve+processing+efficiency.%0D%0A%0D%0AIn+summary%2C+MTOM+messages+larger+than+approximately+1GB+can+cause+problems+due+to+memory+usage%2C+processing+time%2C+network+limitations%2C+and+interoperability+issues.+It%27s+crucial+to+consider+these+factors+when+designing+and+configuring+your+web+services+to+handle+large+MTOM+messages+effectively.")});

ted+approach+to+replicate+SMB+shares.+This+can+involve+using+tools+like+Robocopy+or+rsync+to+synchronize+the+data+between+servers+periodically.+While+this+method+may+require+more+setup+and+maintenance%2C+it+can+provide+more+control+over+the+replication+process.%0D%0A%0D%0AWhen+replicating+SMB+shares%2C+it%27s+essential+to+consider+factors+such+as+the+replication+method%2C+network+bandwidth%2C+storage+capacity%2C+and+the+desired+level+of+redundancy+and+fault+tolerance.+It%27s+also+crucial+to+monitor+the+replication+process+and+ensure+that+any+issues+or+conflicts+are+resolved+promptly+to+maintain+data+integrity+and+consistency.")});
